import React, { useEffect, useRef } from "react";
import { Link } from "react-router-dom";
import "../../styles/EmployeeOwnership.css";

function EmployeeOwnership() {
  const featureRefs = useRef([]);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            entry.target.classList.add("animate-in");
          }
        });
      },
      { threshold: 0.1 }
    );

    featureRefs.current.forEach(ref => {
      if (ref) observer.observe(ref);
    });

    return () => {
      featureRefs.current.forEach(ref => {
        if (ref) observer.unobserve(ref);
      });
    };
  }, []);

  const setRefs = (el, index) => {
    featureRefs.current[index] = el;
  };

  return (
    <div className="eo-container">

      {/* HERO SECTION */}
      <section className="eo-hero">
        <h1>Employee Ownership at RGM Logistics</h1>
        <p>Built Like a Family. Grown Together.</p>
      </section>

      {/* INTRO */}
      <section className="eo-intro">
        <p>
          At <strong>RGM Logistics</strong>, we believe a company is strongest 
          when the people behind it feel truly invested â€” not just in their work, 
          but in each other. We are not just building a logistics company; 
          we are building <strong>a family that grows together.</strong>
        </p>
      </section>

      {/* SECTIONS */}
      <section className="eo-sections">

        <div className="eo-section">
          <h2>What Employee Ownership Means to Us</h2>
          <p>
            Employee ownership isnâ€™t just about shares or titles â€” itâ€™s about <strong>mindset</strong>.
            Every team member matters. Every role contributes to success. Every win is shared.
          </p>
        </div>

        <div className="eo-section">
          <h2>Why Work in a Family-Driven Company Like RGM?</h2>

          <div className="eo-feature" ref={(el) => setRefs(el, 0)}>
            <h3>ðŸ”’ Stability & Job Security</h3>
            <p>
              Companies built on trust and teamwork last longer. At RGM, we focus 
              on long-term relationships. As we grow, our people grow with us.
            </p>
          </div>

          <div className="eo-feature" ref={(el) => setRefs(el, 1)}>
            <h3>ðŸ¤œðŸ¤› Together, Everyone Achieves More</h3>
            <p>
              Collaboration beats competition. Ideas are encouraged, effort is recognized. 
              We succeed as one team, not as individuals working alone.
            </p>
          </div>

          <div className="eo-feature" ref={(el) => setRefs(el, 2)}>
            <h3>ðŸ’° Growth Beyond a Paycheck</h3>
            <p>
              Career development, skill building, leadership opportunities, and long-term financial growth. 
              When the company performs better, everyone benefits â€” professionally and personally.
            </p>
          </div>

          <div className="eo-feature" ref={(el) => setRefs(el, 3)}>
            <h3>ðŸš€ Long-Term Potential</h3>
            <p>
              As RGM expands, new opportunities open, leadership roles are created internally, 
              and team members grow into stronger versions of themselves.
            </p>
          </div>

          <div className="eo-feature" ref={(el) => setRefs(el, 4)}>
            <h3>ðŸŒŸ A Rare Kind of Workplace</h3>
            <p>
              Supportive, transparent, respectful, people-first â€” a combination that is rare and valuable.
            </p>
          </div>

        </div>

      </section>

      {/* CTA SECTION */}
      <section className="eo-cta">
        <h2>The RGM Promise</h2>
        <p>
          When you join RGM Logistics, you donâ€™t just join a company. 
          You join a family that has your back. A team that listens. A culture that values loyalty, honesty, and hard work.
        </p>
        <Link to="/join/apply" className="eo-apply-btn">Join the RGM Family</Link>
      </section>

    </div>
  );
}

export default EmployeeOwnership;
